import Slider from "rc-slider"

const image = 'images/church_images/PXP-1451.jpg'

function AboutUs() {
  return (
    <div className="bg-amber-950 w-screen h-screen" id="about">
      <div className="flex justify-around">
          <img src={image} className="w-96 h-96 p-8"/>
      </div>
    </div>
  )
}

export default AboutUs
